angular.module("KeepIt").provider("KeepItSessionStorageService",["KeepItProvider",function(a){return a.registerModule("KeepItSessionStorageService",a.types.SESSION),{$get:function(){return function(a){return{cacheId:a,module:sessionStorage,computeKey:function(b){return"_KeepItModule_"+a+b},_put:function(a,b){sessionStorage.setItem(this.computeKey(a),JSON.stringify(b))},_get:function(a){return JSON.parse(sessionStorage.getItem(this.computeKey(a)))},_remove:function(a){sessionStorage.removeItem(this.computeKey(a))},_destroy:function(){angular.forEach(this.registeredKeys,function(a,b){sessionStorage.removeItem(this.computeKey(b))})}}}}}}]);